import React, { useState } from 'react';

const Son = () => {
  let [state, setState] = useState((props) => {
    if (props.init > 60) {
      console.log('大于60');
    }
  });
  return (
    <div>
      <h1>son组件</h1>
      <p>{state}</p>
    </div>
  );
};
export default function App() {
  return (
    <div>
      <Son init={60} />
    </div>
  );
}
